import React, { useState } from 'react';
import { FaChartLine, FaEye, FaTrash } from 'react-icons/fa';

/**
 * Komponent wyświetlający przesłane badania z możliwością analizy, podglądu i usuwania.
 * Po kliknięciu "Pokaż analizę" wyświetla sekcje: "Analiza oraz interpretacja" oraz "Tabela wyników".
 */
function PrzeslaneBadania({
  files,
  loadingAnalysis,
  handleAnalyze,
  handleShowAnalysis,
  handleDelete,
  formatDate,
  styles,
  setFiles
}) {
  // Stan do przechowywania aktualnie wybranego dokumentu do podglądu analizy
  const [selectedDoc, setSelectedDoc] = useState(null);

  // Dodajemy style dla krótszych przycisków
  const shorterButtonStyle = {
    maxWidth: '30%',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
    whiteSpace: 'nowrap',
    padding: '4px 8px',
    fontSize: '0.85em'
  };

  // Funkcja do zamknięcia podglądu analizy
  const handleCloseAnalysis = () => setSelectedDoc(null);

  return (
    <div>
      <h2>Przesłane badania</h2>
      {files.documents.length === 0 ? (
        <p>Brak plików</p>
      ) : (
        <div>
          {files.documents.map(doc => (
            <div key={doc.id} style={styles.fileItem}>
              <div style={styles.fileHeader}>
                <div style={styles.fileName}>{doc.filename}</div>
                <div style={styles.fileDate}>{formatDate(doc.upload_date)}</div>
              </div>
              <div style={styles.fileActions}>
                {doc.analysis ? (
                  <button
                    style={{ ...styles.button, ...styles.smallButton, ...shorterButtonStyle }}
                    onClick={() => setSelectedDoc(doc)}
                  >
                    <FaEye /> Pokaż analizę
                  </button>
                ) : (
                  <button
                    style={{ ...styles.button, ...styles.smallButton, ...shorterButtonStyle }}
                    onClick={() => handleAnalyze(doc)}
                    disabled={loadingAnalysis === doc.id}
                  >
                    {loadingAnalysis === doc.id ? (
                      <>Analizuję...</>
                    ) : (
                      <><FaChartLine /> Analizuj</>
                    )}
                  </button>
                )}
                <button
                  style={{
                    ...styles.button,
                    ...styles.smallButton,
                    ...styles.secondaryButton,
                    ...shorterButtonStyle
                  }}
                  onClick={() => handleDelete(doc.id)}
                >
                  <FaTrash /> Usuń
                </button>
              </div>
            </div>
          ))}

          {files.totalPages > 1 && (
            <div style={styles.pagination}>
              <button
                style={{ ...styles.pageButton }}
                onClick={() => setFiles(prev => ({ ...prev, page: prev.page - 1 }))}
                disabled={files.page === 1}
              >
                Poprzednia
              </button>
              <span>{files.page} z {files.totalPages}</span>
              <button
                style={{ ...styles.pageButton }}
                onClick={() => setFiles(prev => ({ ...prev, page: prev.page + 1 }))}
                disabled={files.page === files.totalPages}
              >
                Następna
              </button>
            </div>
          )}

          {/* Modal lub sekcja z analizą i tabelą */}
          {selectedDoc && selectedDoc.analysis && (
            <div style={{
              marginTop: '2em',
              padding: '1em',
              border: '1px solid #ddd',
              borderRadius: '8px',
              background: '#fafbfc'
            }}>
              <button
                style={{
                  float: 'right',
                  marginBottom: '1em',
                  background: 'none',
                  border: 'none',
                  fontSize: '1.2em',
                  cursor: 'pointer'
                }}
                onClick={handleCloseAnalysis}
                title="Zamknij"
              >
                ×
              </button>
              <h3>Analiza oraz interpretacja</h3>
              <div style={{ marginBottom: '1.5em' }}>
                {/* Zakładamy, że podsumowanie tekstowe jest w selectedDoc.analysis.summary */}
                {selectedDoc.analysis.summary
                  ? <p>{selectedDoc.analysis.summary}</p>
                  : <p><i>Brak podsumowania.</i></p>
                }
              </div>
              <h3>Tabela wyników</h3>
              <div style={{ overflowX: 'auto' }}>
                {/* Zakładamy, że tabela HTML jest w selectedDoc.analysis.tableHtml */}
                {selectedDoc.analysis.tableHtml
                  ? (
                    <div
                      dangerouslySetInnerHTML={{ __html: selectedDoc.analysis.tableHtml }}
                    />
                  )
                  : <p><i>Brak tabeli wyników.</i></p>
                }
              </div>
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default PrzeslaneBadania;
